import { Link } from 'react-router-dom';
import delmonte from '../assets/delmonte.svg';
import './styles.css';

export const Home = () => {
    return(
        <div className="home">
            <div className='logo'>
                <img src={delmonte}/>
            </div>
            <h1>Welcome to Hyperledger Demo</h1>
            <section>
                <ol>
                <li><Link to="/producer">Producer</Link></li>
                <li><Link to="/manufacturer">Manufacturer</Link></li>
                <li><Link to="/deliverer">Deliverer</Link></li>
               <li> <Link to="/sushi">Sushi</Link></li>
               <li><Link to="/retailer">Retailer</Link></li>
                </ol>
            </section>
        </div>
    )
}
